import React from "react"

const LocationInfo = () => {

    var today = new Date();
    var date = today.getFullYear()+'-'+(today.getMonth()+1)+'-'+today.getDate();

    return (
        <div style={{backgroundColor: "#4f86f7", borderRadius: "10px", width: "50%"}} className="m-3 px-3" > 
            <p>{date}</p>
            <p>Time</p>
            <p>Location</p>
        </div>
    )
}

export default LocationInfo;
